        <div class=""footer_container clear_float"">

            <div class=""app_guide"">

                    Bonjour chers encadreurs et chers étudiants 

                    Les cours en ligne obéissent à une charte qui est que les étudiant-e-s doivent se plier aux exigences académiques. 

                    Chaque cours démarre avec des interactions avec l'enseignant (e) et c'est obligatoire car cela est noté. Les étudiant-e-s qui n'interagissent pas sont considérés comme des absents. 

                    L'enseignant(e) est le seul à assurer l'animation du cours et les étudiant-e-s doivent se plier à ses directives. 

                    Après les présentations, et en fonction du cours, l'enseignant(e) peut lancer une thématique de discussion en rapport avec son cours, ou un exercice lui permettant d'apprécier le niveau général des étudiant-e-s. Par la suite il/elle en fera la synthèse et invitera les étudiant-e-s à lire son cours en le téléchargeant dans le bloc DOCUMENTS. Après la");
                WriteLiteral(@" lecture chaque étudiant(e) pose les questions de compréhension nécessaires dans le forum et l'enseignant(e) y apporte les réponses. 

                    A l'issue de cette phase, l'enseignant(e) peut donner des exercices additionnels (TD) aux étudiant-e-s ou alors décider de programmer une évaluation si la compréhension du cours par les étudiant-e-s est jugée bonne. 

                    L'évaluation se fait en ligne et chaque étudiant(e) doit s'assurer d'avoir une connexion internet fiable pour faire le devoir car nous estimons que le choix des cours en ligne est motivé par votre aptitude à trouver une connexion internet fiable pour pouvoir les suivre sans trop de difficultés. Il n'y a pas d'heures ni de jour commun à tous les étudiants pour l'évaluation. Par contre une fois que le devoir est convenu, chaque étudiant(e) doit le faire dans un délai d'une semaine. Autrement dit il sera considéré comme absent au devoir et la note zéro lui est attribuée d'emblée. Il/elle devra se justifier valablement avan");
                WriteLiteral(@"t d'être autorisé (e) à en composer un autre. Les copies de chaque évaluation sont déposées dans les casiers des étudiants dans le bloc SHARE ou PARTAGE et chaque étudiant(e) ne verra que sa propre copie annotée. Cette étape met fin au cours en question. 

                    Nous voudrions donc vous exhorter à suivre scrupuleusement ces exigences car toute étude doit répondre à des exigences pour être valides. 

                    The discussion forum is to be considered as your virtual classroom and your absence from discussions launched on the forum is equivalent to absences from class. It should be remembered that studying online gives you more freedom to take your lessons wherever you are (during your breaks at the office, in town, at home or any other setting that you deem suitable). But there are quality criteria that must be observed in order for the course to meet the standards for obtaining a degree.

                    We do this post in all programs because on a recurring basis many studen");
